import React from "react";
import styles from "./server.module.scss";

const UrlComponent = () => {
  return (
    <div className={styles["url-component"]}>
      <button>Add</button>
      <button>Delete</button>
      <input value="url" />
      <button>Add Variable</button>
    </div>
  );
};

export default UrlComponent;
